        [Fact]
        public void SaveHealthRecord()
        {
            string fileName = "C:\\Users\\angel\\source\\repos\\Annihilator3180\\CECS-491A-Senior-Project\\Backend\\The6Bits.BitOHealth\\dummy.pdf";
            using var stream = new MemoryStream(File.ReadAllBytes(fileName).ToArray());
            FormFile formFile = new FormFile(stream, 0, stream.Length, "streamFile", "dummy.pdf")
            {
                Headers = new HeaderDictionary(),
                ContentType = "application/pdf"
            };

            string expected = "saved";

            string actual = _HealthRecorderService.SaveRecord(formFile, "bossadmin12", "test3", "test3");

            Assert.Equal(expected, actual);

            HealthRecorderRequestModel request = new HealthRecorderRequestModel("test3", "test3");
            HealthRecorderResponseModel response = new HealthRecorderResponseModel();
            _HealthRecorderService.DeleteRecord(request, response, "bossadmin12");

        }
